import { StyleSheet } from "react-native";

const Styles = StyleSheet.create({
  scrolling: {
    width: "100%",
    backgroundColor: "transparent",
  },

  wrapScrollView: {
    paddingTop: 20,
    paddingBottom: 100,
    paddingHorizontal: 25,
  },
});

export default Styles;
